import './css/puc.css'

function Puc()
{
    return(
        <>
            <div className="container-fluid puc_bg p-5">
	
                <div className="row p-5">
                    <div className="col-md-8 mx-auto inner_cont text-center py-4">
                        <h1> Page Under Construction <i className="fa-regular fa-sun"></i> </h1>
                        <h2>Coming Soon <i className="fa-regular fa-clock"></i></h2>

                        <div className="d-flex flex-wrap my-5">
                            <div className="timer_div mx-auto pt-2">
                                <p id="days"></p>
                                <h5>Days</h5>
                            </div>

                            <div className="timer_div mx-auto pt-2">
                                <p id="hr"></p>
                                <h5>Hours</h5>
                            </div>

                            <div className="timer_div mx-auto pt-2">
                                <p id="min"></p>
                                <h5>Minutes</h5>
                            </div>

                            <div className="timer_div mx-auto pt-2">
                                <p id="sec"></p>
                                <h5>Seconds</h5>
                            </div>
                        </div>


                        <form className="my-5">

                            <div className="mx-auto mb-3 w-50">
                                <input type="email" className="form-control" placeholder="Your Email" />
                            </div>

                            <button type="submit" className="btn btn-primary get_notified_btn">Get Notified</button>

                        </form>

                    </div>
                </div>


            </div>



        </>
    )
}

export default Puc;






var countDownDate = new Date("Jan 11, 2023 14:00:00").getTime();

var x = setInterval(function() {

var now = new Date().getTime();
    
var distance = countDownDate - now;
    
var days = Math.floor(distance / (1000 * 60 * 60 * 24));
var hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
var minutes = Math.floor((distance % (1000 * 60 * 60)) / (1000 * 60));
var seconds = Math.floor((distance % (1000 * 60)) / 1000);
    
document.getElementById("days").innerHTML = days;

document.getElementById("hr").innerHTML = hours;

document.getElementById("min").innerHTML = minutes;

document.getElementById("sec").innerHTML = seconds;

// If the count down is over, write some text 
if (distance < 0) {
    clearInterval(x);
    document.getElementById("demo").innerHTML = "ALMOST DONE !!";
}
}, 1000);
